import React from 'react';

class Casting extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				the goal of this page is to introduce you to the topic of <b>casting</b>, which we will subsequently use in the next two pages, the <b className="pageName">random numbers page</b> and the <b className="pageName">ASCII page</b>. (<b className="note">btw:</b> thankfully casting has nothing to do with breaking your arm or leg!)
				<h3>(recap)</h3>
				<b>sweet!</b> you made it to recap!
				<br/><br/>
				...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default Casting;
